	add("matric", "{\"term\":\"matric\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The final year of high school\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone in their final year of high school\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, \u0027A Dry White Season\u0027, Vintage 1998, p. 37\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Once, when some money disappeared […], it was Ben who took the cleaner under his wing and instituted inquiries which revealed a group of \u0027\u0027matric\u0027\u0027 boys to be the culprits\", \"priority\":4}]}, \"synonyms\":{}}");

	add("matriotism", "{\"term\":\"matriotism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A blend of alma mater and patriotism, later reanalyzed as derived from matri- by analogy with patriotism\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hometown, school, or parish pride or loyalty, as opposed to nationalism or patriotis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"But though Mr. Lang\u0027s \u0027\u0027matriotism\u0027\u0027 is thus divided, he has only one fatherland, [Scotland,] and to that he is faithful against the world\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Love or celebration of a woman\u0027s influence upon society; a women\u0027s equivalent to male patriotis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Matriotism\u0027\u0027 of household economics needs to be recognized as necessary for the whole of society\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Love of the motherland, as opposed to patriotism as love of the fatherland\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Pacifist patriotism; love of society as opposed to love of the stat\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a Matriot would never send her child or another mother’s child to fight nonsense wars. She would march into war herself to protect her child from harm. Patriots cower behind the flag and send young people to die for the sake of material wealth\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Devotion to Mother Earth, ecology, sustainability, peace and the survival of the human species as long as possible\", \"priority\":8}]}, \"synonyms\":{}}");

	add("matron", "{\"term\":\"matron\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027matrone\u0027 Latin \u0027matrona|lang\u003dla\u0027 () from \u0027mater|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mature woman; a wife or a widow, especially, one who has borne children; a woman of staid or motherly manners\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"your wives, your daughters, your \u0027\u0027matrons\u0027\u0027, and your maid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1606-1661\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"grave from her cradle, insomuch that she was a \u0027\u0027matron\u0027\u0027 before she was a mothe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"“A tight little craft,” was Austin’s invariable comment on the \u0027\u0027matron\u0027\u0027; and she looked it, always trim and trig and smooth of surface like a converted yacht cleared for action. \u0026amp;para; Near her wandered her husband, orientally bland, invariably affable\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A housekeeper; especially, a woman who manages the domestic economy of a public institution; a head nurse in a hospital\", \"priority\":7}]}, \"synonyms\":{}}");

